return ['domain'=>NULL,'plural-forms'=>'nplurals=2; plural=(n > 1);','language'=>'fr_FR','pot-creation-date'=>'2025-06-09 11:31-0700','po-revision-date'=>'2025-06-09 11:33-0700','translation-revision-date'=>'2025-06-09 11:33-0700','project-id-version'=>'Print My Blog','x-generator'=>'Poedit 3.6','messages'=>['Purpose'=>'Objectif','Similar to Print My Blog Quick Print and dotEpub, but supporting Pro features. Great for printing your WordPress content as an eBook for reading from a tablet or phone, or uploading to eBook marketplaces like Amazon or Apple Book Store.'=>'Très similaire à Print My Blog gratuit, mais en soutenant les fonctionnalités Pro. Idéal pour imprimer votre contenu WordPress.','A table of contents is generated and inserted into the book (no need to add it using an external service like Kindle Direct Publishing or Calibre).'=>'Une table des matières est générée et insérée dans le livre (pas besoin de l’ajouter à l’aide d’un service externe comme Kindle Direct Publishing ou Calibre).','Images are bundled into the book file so they can be used offline.'=>'Les images sont regroupées dans le fichier du livre afin qu’elles puissent être utilisées hors ligne.','Image galleries are rearranged into a simple list of images which displays better on smaller devices.'=>'Les galeries d’images sont réorganisées en une simple liste d’images qui s’affiche mieux sur les appareils plus petits.','If there are any features or options you want, %1$splease get in touch.%2$s'=>'S’il y a des fonctionnalités ou des options que vous voulez, %1$sveuillez nous contacter. %2$s','Features'=>'Caractéristiques','Supports nesting articles (like posts and pages) into “parts”'=>'Prend en charge les articles de nidification (comme les messages et les pages) en « parties »','External hyperlinks (links to web pages not in the project) are left as working hyperlinks'=>'Les hyperliens externes (liens vers des pages Web ne figurant pas dans le projet) sont laissés en tant qu\'hyperliens fonctionnels','Internal hyperlinks (links to content included in the project) are converted into links to the appropriate page of the eBook'=>'Les hyperliens internes (liens vers le contenu inclus dans le projet) sont convertis en liens vers la page appropriée de l\'eBook','The default title page can include: Project Title, Subtitle, Site URL, Date Printed, Credit to Print My Blog'=>'La page de titre par défaut peut inclure : Titre du projet, Sous-titre, URL du site, Date imprimée, Crédit pour imprimer mon blog','Each article can include: Title, ID, Author, URL, Date Published, Categories and Tags, Featured Image, Excerpt, Custom Fields, Content'=>'Chaque article peut inclure : Titre, ID, Auteur, URL, Date publiée, Catégories et tags, Image en vedette, Extrait, Contenu','All images are automatically included in the ePub file (instead of merely pointing to the external image source). This makes the filesize larger, but allows users to view images while disconnected from the Internet.'=>'Toutes les images sont automatiquement incluses dans le fichier ePub (au lieu de simplement pointer vers la source d’image externe). Cela agrandit la taille du fichier, mais permet aux utilisateurs de visualiser des images lorsqu’ils sont déconnectés d’Internet.','Small images are automatically centered'=>'Les petites images sont automatiquement centrées','Image galleries are converted into regular list of images, which look better on small screens.'=>'Les galeries d\'images sont converties en une liste régulière d\'images, qui s\'affichent mieux sur les petits écrans.','Page Layout'=>'Mise en page','The page design is mostly dictated by the app and device used for reading'=>'La conception de la page est principalement dictée par l’application et l’appareil utilisés pour la lecture','Each article begins on a new page.'=>'Chaque article commence sur une nouvelle page.','ID:%s'=>'ID: %s','By %s'=>'Par %s','Powered by WordPress & Print My Blog'=>'Propulsé par WordPress & Print My Blog','comments title' . "\4" . 'One Reply to &ldquo;%s&rdquo;'=>'Un commentaire à &ldquo;%s&rdquo;','comments title' . "\4" . '%1$s Reply to &ldquo;%2$s&rdquo;'=>'%1$s réponse à  &ldquo;%2$s&rdquo;' . "\0" . '%1$s réponses à  &ldquo;%2$s&rdquo;','Printed on %1$s'=>'Imprimé le %1$s','Designed for a school, company, or organization that wants to include their name, logo, and colors throughout the PDF. Because of its exstensive use of colors, it’s usually best viewed from a computer or handheld device.'=>'Conçu pour une école, une entreprise ou une organisation qui veut inclure son nom, son logo et ses couleurs dans tout le PDF. En raison de son utilisation exstensive des couleurs, il est généralement préférable de visualisé à partir d’un ordinateur ou d’un appareil portatif.','Easier content editing because there are no nesting parts.'=>'Modification plus facile du contenu car il n’y a pas de parties de nidification.','All hyperlinks converted into footnotes'=>'Tous les hyperliens transformés en notes de bas de page','The title page can include your organization’s name, project title, issue number, list of authors, and an introductory paragraph.'=>'La page de titre peut inclure le nom de votre organisation, le titre du projet, le numéro de numéro de numéro, la liste des auteurs et un paragraphe introductif.','Each article includes just its title and content'=>'Chaque article comprend seulement son titre et son contenu','The default title page includes a stylized banner (with customizable color) above a colored background featuring a large version of your company logo.'=>'La page de titre par défaut comprend une bannière stylisée (avec couleur personnalisable) au-dessus d’un fond coloré comportant une grande version du logo de votre entreprise.','Main matter pages fade from white to a color of your choosing in the corner where your logo and page number are shown.'=>'Les pages de matière principale s’estompent du blanc à une couleur de votre choix dans le coin où votre logo et numéro de page sont affichés.','Page numbers in bottom-right corner, and article titles in the top-right. Front-matter’s pages are numbered with Roman numerals'=>'Numéros de page dans le coin inférieur droit, et titres d’article en haut à droite. Les pages de Front-matter sont numérotées avec des chiffres romains','Each article begins on a new page'=>'Chaque article commence sur une nouvelle page','Back matter uses your large company logo with background color'=>'La matière arrière utilise le logo de votre grande entreprise avec la couleur de fond','Very similar to Print My Blog Quick Print, but supporting Pro features. Great for making a PDF for an easy-to-read digital backup of your favorite website content.'=>'Très similaire à Imprimer mon blog Quick Print, mais en soutenant les fonctionnalités Pro. Idéal pour faire un PDF pour une sauvegarde numérique facile à lire de votre contenu de site web préféré.','External hyperlinks (links to web pages not in the project) can be automatically converted to footnotes, left in-place, or removed'=>'Les hyperliens externes (liens vers des pages Web qui ne sont pas dans le projet) peuvent être automatiquement convertis en notes de bas de page, laissés en place ou supprimés','Footnotes only work with Pro'=>'Les notes de bas de page ne fonctionnent qu’avec Pro','Internal hyperlinks (links to content included in the project) can be automatically converted to to footnotes, inline page references, left in-place, or removed'=>'Les hyperliens internes (liens vers le contenu inclus dans le projet) peuvent être automatiquement convertis en notes de bas de page, références de pages en ligne, laissés en place ou supprimés','Footnotes and page references only work with Pro PDF Service'=>'Les notes de bas de page et les références de page ne fonctionnent qu’avec pro print service','Limit image size by setting maximum height'=>'Limitez la taille de l’image en fixant la hauteur maximale','Optionally automatically center images'=>'Centrer automatiquement les images en option','Optionally float images to the top or bottom of each page'=>'Flotter en option des images en haut ou en bas de chaque page','Page numbers in bottom-right corner, article titles in the top-right, and part titles (if using parts) appear in the top-left corner. Front-matter’s pages are numbered with Roman numerals'=>'Les numéros de page dans le coin inférieur-droit, les titres d’article en haut à droite et les titres de pièces (si vous utilisez des pièces) apparaissent dans le coin supérieur gauche. Les pages de Front-matter sont numérotées avec des chiffres romains','Most browsers add their own content to the page margins'=>'La plupart des navigateurs ajoutent leur propre contenu aux marges de la page','Each article can optionally begin on a new page'=>'Chaque article peut commencer en option sur une nouvelle page','Designed to look good when viewed from a device or printing to paper. The two-column layout leads to more compact content, especially good if your content doesn’t require the full page width'=>'Conçu pour être beau lorsqu’il est vu à partir d’un appareil ou d’une impression sur papier. La mise en page à deux colonnes conduit à un contenu plus compact, surtout si votre contenu ne nécessite pas la largeur complète de la page','Most browsers will only print a white background'=>'La plupart des navigateurs n’imprimeront qu’un fond blanc','Main matter is divided into two columns, while front matter uses the full page width.'=>'La matière principale est divisée en deux colonnes, tandis que la matière avant utilise la largeur de la pleine page.','Some browsers don‘t support multiple columns'=>'Certains navigateurs ne supporte pas plusieurs colonnes','Content can be divided into parts with a special part opening area using the full page width.'=>'Le contenu peut être divisé en parties avec une zone d’ouverture de pièce spéciale en utilisant la largeur de la pleine page.','The title page can include a title and preamble. Other content can immediately follow, without needing a page break.'=>'La page de titre peut inclure un titre et un préambule. D’autres contenus peuvent immédiatement suivre, sans avoir besoin d’une pause page.','Each article includes just its title and content, and an optional dividing line to help distinguish between articles.'=>'Chaque article comprend seulement son titre et son contenu, ainsi qu’une ligne de démarcation facultative pour aider à distinguer les articles.','If your content is already divided into columns, optionally automatically remove them to improve the layout.'=>'Si votre contenu est déjà divisé en colonnes, supprimez-les automatiquement en option pour améliorer la mise en page.','Optionally begin each post on a new page, or be shown immediately following the previous one.'=>'Commencez chaque publication sur une nouvelle page ou affichez-la immédiatement après la précédente.','Optionally have each article title take up the full page width, or show them inside columns.'=>'En option, chaque titre d’article prend la largeur de la pleine page, ou les montrer à l’intérieur des colonnes.','Internal links (hyperlinks to content included in the project) are replaced with page references.'=>'Les liens internes (hyperliens vers le contenu inclus dans le projet) sont remplacés par des références de page.','External links (hyperlinks to content on the internet) are left as-is.'=>'Les liens externes (hyperliens vers le contenu sur Internet) sont laissés tels qu’ils sont.','Most content is divided between two columns.'=>'La majeure partie du contenu est divisée en deux colonnes.','Page numbers in bottom-right corner, and part titles in the top-left. Front-matter’s pages are numbered with Roman numerals'=>'Numéros de page dans le coin inférieur droit, et titres de partie en haut à gauche. Les pages de Front-matter sont numérotées avec des chiffres romains','Special Instructions'=>'Instructions Particulières','Front matter defaults to using the full page width. To force something to be divided into columns, add the CSS class "mayer-columns" inside your content.'=>'La matière avant ne par défaut à l’aide de la largeur de la pleine page. Pour forcer quelque chose à être divisé en colonnes, ajoutez les colonnes mayer de classe CSS à l’intérieur de votre contenu.','Very similar to Print My Blog Quick Print, but supporting Pro features. Great for printing your WordPress content.'=>'Très similaire à Imprimer mon blog gratuit, mais en soutenant les fonctionnalités Pro. Idéal pour imprimer votre contenu WordPress.','For creating a printout of your WordPress content that saves paper and ink.'=>'Pour créer une impression de votre contenu WordPress qui enregistre le papier et l’encre.','This design uses a smaller font, small images, doesn’t add pagebreaks between articles, and avoids unnecessary extra information.'=>'Cette conception utilise une police plus petite, de petites images, n’ajoute pas de pagebreaks entre les articles, et évite les informations supplémentaires inutiles.','Perfect for editing and reviewing your content! Compact to conserve paper, lots of meta-information, and double-spaced text to allow for editor’s notes.'=>'Parfait pour l’édition et l’examen de votre contenu! Compact pour conserver le papier, beaucoup de méta-informations, et le texte double-espacé pour permettre des notes de l’éditeur.','External hyperlinks (links to web pages not in the project) can be automatically converted to footnotes or removed'=>'Les hyperliens externes (liens vers des pages Web qui ne sont pas dans le projet) peuvent être automatiquement convertis en notes de bas de page ou supprimés','Footnotes require Pro'=>'Les notes de bas de page nécessitent pro','Internal hyperlinks (links to content included in the project) can be automatically converted to footnotes, inline page references, or removed'=>'Les hyperliens internes (liens vers le contenu inclus dans le projet) peuvent être automatiquement convertis en notes de bas de page, références de pages en ligne ou supprimés','Footnotes and page references require Pro PDF Service'=>'Les notes de bas de page et les références de page nécessitent un service d’impression pro','This design is meant for printing on both sides of the page so you see two pages at once (the "page spread"). So the left-hand page will be styled differently than the right-hand page.'=>'Cette conception est destinée à l’impression des deux côtés de la page de sorte que vous voyez deux pages à la fois (le « page spread »). Ainsi, la page de gauche sera sifflé différemment de la page de droite.','Page numbers in bottom-outside corner, part titles appear in the top of the left page, article titles appear at the top of the right page. Front-matter’s pages are numbered with Roman numerals'=>'Numéros de page dans le coin inférieur à l’extérieur, titres de partie apparaissent en haut de la page gauche, titres d’article apparaissent en haut de la page de droite. Les pages de Front-matter sont numérotées avec des chiffres romains','Multi-column newspaper design designed for printing. Wide images can span multiple columns and always snap to the nearest page edge to make a visually-appealing layout.'=>'Conception de journaux multicolonnes conçus pour l’impression. Les images larges peuvent s’étendre sur plusieurs colonnes et toujours s’accrocher au bord de la page le plus proche pour créer une mise en page visuelle.','The "Title page" is actually a special header on the front page containing your publication\'s title, issue number, date, and other optional prominent info (set on the design and project meta settings).'=>'La « Page de titre » est en fait un en-tête spécial sur la page d’accueil contenant le titre de votre publication, le numéro de numéro, la date et d’autres informations importantes facultatives (définies sur les paramètres de conception et de méta du projet).','Content is divided into two, three, or four columns.'=>'Le contenu est divisé en deux, trois ou quatre colonnes.','The top margin contains the front page (publication title, issue number, date, etc.).'=>'La marge supérieure contient la première page (titre de la publication, numéro de numéro, date, etc.).','Designed for duplex printing with the left page mirroring the right page\'s margins.'=>'Conçu pour l’impression recto verso avec la page de gauche reflétant les marges de la page de droite.','Content can be divided into parts. Part openings and important articles\' titles and cover images take up the full page width, whereas regular articles compactly fit into columns.'=>'Le contenu peut être divisé en parties. Les ouvertures de pièces et les titres et images de couverture des articles importants occupent toute la largeur de la page, tandis que les articles ordinaires tiennent de manière compacte dans les colonnes.','Each article may include post title, ID, author, published date, categories and tags, URL, featured image, excerpt, custom fields, and content.'=>'Chaque article peut inclure : Titre, ID, Auteur, URL, Date publiée, Catégories et tags, Image en vedette, Extrait, Contenu','Issue and page number are in the outside top margin, the publication\'s title is in the middle top margin, and the publication date is in the inside top margin. The optional publication subtitle is underneath the other top-margin content.'=>'Le numéro et le numéro de page se trouvent dans la marge supérieure extérieure, le titre de la publication se trouve dans la marge supérieure centrale et la date de publication dans la marge supérieure intérieure. La phrase d’accroche facultative se trouve sous l’autre contenu de marge supérieure.','Section Templates'=>'Modèles de section','Choose different styles for articles included in your project:'=>'Choisissez différents styles pour les articles inclus dans votre projet :','Default Template: shows all content specified by the "Post Content" design setting (e.g. the article\'s title and featured image) in columns.'=>'Modèle par défaut : affiche tout le contenu spécifié par le paramètre de conception « Publier le contenu » (par exemple, le titre de l’article et l’image en vedette) dans des colonnes.','Single Column: like the default template, but in a single column.'=>'Colonne unique : affiche tout le contenu spécifié par le paramètre de conception « Publier du contenu » dans une seule colonne.','Fullpage Content: contains only the article\'s content (no title, featured image, etc.) all in a single, wide column.'=>'Contenu pleine page : contient uniquement le contenu de l’article (pas de titre, d’image en vedette, etc.) dans une seule colonne large.','Full Column Content: like "Fullpage Content", except content is still divided into multiple columns..'=>'Contenu de la colonne complète : comme « Contenu de la page complète », sauf que le contenu est toujours divisé en plusieurs colonnes.','Important: shows the article\'s featured image and title across all columns, but other content is shown in multiple columns.'=>'Important : affiche l’image et le titre de l’article dans toutes les colonnes, mais le reste du contenu est affiché dans plusieurs colonnes.','Parts start on a new page and include the part’s title, featured image, and content.'=>'Les pièces commencent sur une nouvelle page et incluent le titre, l’image en vedette et le contenu de la pièce.','Note that in order to improve page layout, all images and figures snap to the nearest page edge.'=>'Les images « pleine largeur » occupent toutes les colonnes et s’accrochent au bord de la page le plus proche.','"Full width" images take up all columns and snap to the nearest page edge.'=>'Les images « pleine largeur » occupent toutes les colonnes et s’accrochent au bord de la page le plus proche.','"Wide width" images take up 2 columns and snap to the nearest page edge.'=>'Les images « grande largeur » occupent 2 colonnes et s’accrochent au bord de la page le plus proche.','Only works with PMB’s Pro PDF Service.'=>'Fonctionne uniquement avec le service Pro PDF de PMB.','%1$sAdd the CSS class "%2$s"%3$s to any images you don\'t want to snap like this.'=>'%1$s Ajoutez la classe CSS « %2$s"%3$s à toutes les images que vous ne voulez pas prendre comme ça.','Issue %s, Page %s'=>'Publication %s, page %s','Issue %s'=>'Publication %s','Similar to Print My Blog Quick Print\'s other "Classic" designs, except optimized for reading by Microsoft Word. Useful when you need to deliver your content as a Microsoft Word Document (like to an editor), or for using as an intermediate format for delivery to other applications (like for importing into Adobe InDesign).'=>'Similaire aux autres conceptions « classiques » de Print My Blog Quick Print, sauf optimisées pour la lecture par Microsoft Word. Utile lorsque vous devez diffuser votre contenu en tant que document Microsoft Word (comme pour un éditeur) ou pour l’utiliser comme format intermédiaire pour la diffusion vers d’autres applications (comme pour l’importation dans Adobe InDesign).','A table of contents is generated and inserted at the requested location. Once in Microsoft Word, right click on the table of contents and click "Update Field"; or press Ctrl + A, then F9.'=>'Une table des matières est générée et insérée à l’emplacement demandé. Une fois dans Microsoft Word, faites un clic droit sur la table des matières et cliquez sur « Mettre à jour le champ »; ou appuyez sur Ctrl + A, puis sur F9.','Images may be bundled into the Word Document file so they can be used offline or if the website hosting the images goes offline.'=>'Les images peuvent être regroupées dans le fichier Word Document afin de pouvoir être utilisées hors ligne ou si le site Web hébergeant les images se déconnecte.','External hyperlinks (links to web pages not in the project) may be left as working hyperlinks or removed'=>'Les hyperliens externes (liens vers des pages Web ne figurant pas dans le projet) peuvent être laissés en tant qu\'hyperliens fonctionnels ou supprimés','Internal hyperlinks (links to content included in the project) may be converted into links to the appropriate page of the document, left as hyperlinks to the website, or removed.'=>'Les hyperliens internes (liens vers le contenu inclus dans le projet) peuvent être convertis en liens vers la page appropriée du document, laissés sous forme d\'hyperliens vers le site Web ou supprimés.','All images are automatically included in the Word Document file (instead of merely pointing to the external image source). This makes the filesize larger, but allows users to view images while disconnected from the Internet.'=>'Toutes les images sont automatiquement incluses dans le fichier de document Word (au lieu de simplement pointer vers la source d’image externe). Cela agrandit la taille du fichier, mais permet aux utilisateurs de visualiser des images lorsqu’ils sont déconnectés d’Internet.','Powered by Print My Blog Pro & WordPress'=>'Desarrollado por Print My Blog Pro y WordPress','Purchase Required'=>'Achat requis','Works better with %1$sPro PDF Service%2$s'=>'Fonctionne mieux avec %1$sPro PDF Service%2$s','More Advanced Features in %1$sPro Print%2$s'=>'Fonctionnalités plus avancées dans %1$sPro Print%2$s','Drag the %s "%s" into your project'=>'Faites glisser %s « %s » dans votre projet','View "%s"'=>'Voir "%s"','Edit "%s"'=>'Modifier "%s"','Replace "%s" with the existing Print Material for customizing.'=>'Remplacez « %s » par le matériel d’impression existant pour la personnalisation.','Replace "%s" with a New Print Material for customizing'=>'Remplacez « %s » par un nouveau matériel d’impression pour personnaliser','Upgrade to Professional License for one-click copying to Print Materials for customization.'=>'Effectuez une mise à niveau vers une licence professionnelle pour une copie en un clic vers Print Materials à des fins de personnalisation.','Add "%s" to project'=>'Ajouter « %s » au projet','Remove "%s"'=>'Supprimer « %s »','Drag or click here'=>'Faites glisser ou cliquez ici','Post custom field name' . "\4" . '%s:'=>'%