z-moi à imprimer mon blog','Help'=>'Aide','Keyboard Accessibility'=>'Accessibilité du clavier','Settings Saved!'=>'Réglages enregistrés !','You should see the changes on your %1$slatest post%2$s.'=>'Vous devriez voir les modifications sur votre %1$s post%2$s.','Show print buttons on:'=>'Afficher les boutons d’impression sur :','Note: you need to upgrade your license to access the following formats: %s'=>'Remarque : vous devez mettre à niveau votre licence pour accéder aux formats suivants : %s','Print Formats'=>'Formats d’impression','Email Print My Blog Support'=>'E-mail Imprimer mon support blog','Email successfully sent. Expect a reply in the next 1-2 business days.'=>'E-mail envoyé avec succès. Attendez-vous à une réponse dans les 1-2 prochains jours ouvrables.','There was an error sending an email from your website (it was "%1$s"). Please manually send an email to %2$s, with the subject "%3$s", with the content:'=>'Il y a eu une erreur en envoyant un e-mail de votre site Web (c’était %1$s »). S’il vous plaît envoyer manuellement un %2$s à la %3$s, avec le sujet « %3$s », avec le contenu:','Please explain what you did, what you expected, and what went wrong'=>'S’il vous plaît expliquer ce que vous avez fait, ce que vous attendiez, et ce qui s’est mal passé','Including links to screenshots is appreciated'=>'Y compris les liens vers des captures d’écran est apprécié','Your Name'=>'Votre nom','Are you ok with us viewing your most recent generated documents?'=>'Êtes-vous d’accord avec nous pour voir vos documents les plus récents générés?','Viewing your most recent generated documents saves a lot of time figuring out what is going wrong. We won’t share your content with anyone else.'=>'L’affichage de vos documents les plus récents permet d’économiser beaucoup de temps pour comprendre ce qui ne va pas. Nous ne partagerons votre contenu avec personne d’autre.','This debug info will also be sent.'=>'Cette info de débogage sera également envoyée.','This is mostly system information, list of active plugins, active theme, and some Print My Blog Pro info like your most recent projects.'=>'Il s’agit principalement d’informations système, liste de plugins actifs, thème actif, et quelques informations Imprimer mon blog Pro comme vos projets les plus récents.','Support for your plan is offered on GitHub'=>'Le support de votre plan est offert sur GitHub','GitHub is a public forum to share your issues with the developer and other users.'=>'GitHub est un forum public pour partager vos problèmes avec le développeur et d’autres utilisateurs.','You will need to first %1$screate a GitHub account%2$s. If you prefer to use email support please %3$spurchase a license that offers email support.%2$s'=>'Vous devrez d\'abord %1$scréer un compte GitHub%2$s. Si vous préférez utiliser l\'assistance par e-mail, veuillez %3$sacheter une licence offrant une assistance par e-mail.%2$s','Delete All Data'=>'Effacer toutes les données','Please select items to add to the project'=>'Veuillez sélectionner les éléments à ajouter au projet','Please select items to remove'=>'Veuillez sélectionner les éléments à supprimer','Please select items to move'=>'Veuillez sélectionner les éléments à déplacer','Error inserting. Please use the PMB help page to get help'=>'Erreur d’insertion. Veuillez utiliser la page d’aide PMB pour obtenir de l’aide','Error creating new print material. Please use the PMB help page to get help.'=>'Erreur d’insertion. Veuillez utiliser la page d’aide PMB pour obtenir de l’aide','Your project\'s Body is empty. You may have forgetten to drag items from "Available Content" (on the left) into the "Chosen Project Content"\'s Body (on the right). Are you sure you want to leave your project\'s Body empty?'=>'Le corps de votre projet est vide. Vous avez peut-être oublié de faire glisser des éléments de « Contenu disponible » (à gauche) dans le corps du « Contenu du projet choisi » (à droite). Êtes-vous sûr de vouloir laisser le corps de votre projet vide ?','There was an error preparing your content. Please visit the Print My Blog Help page.'=>'Il y a eu une erreur préparant votre contenu. S’il vous plaît visitez la page d’aide Imprimer mon blog.','Your project could not be accessed in order to generate the file. Maybe your website is not public? Please visit the Print My Blog Help page.'=>'Votre projet n’a pas pu être consulté afin de générer le fichier. Peut-être que votre site n’est pas public? S’il vous plaît visitez la page d’aide Imprimer mon blog.','Are you sure you want to duplicate this project?'=>'Etes-vous sûr de vouloir réinitialiser les paramètres en défaut ?','There was an error communicating with Print My Blog Central. It was %s'=>'Il y avait une erreur de communication avec Imprimer mon blog central. C’était %s','Design "%s" successfully saved.'=>'Design « %s » enregistré avec succès.','An invalid design (%1$s) or format provided(%2$s)'=>'Une conception (%1$s) ou un format non valide fourni (%2$s)','%1$s is now the default design the %2$s on all new projects.'=>'%1$s est maintenant la conception par défaut que le %2$s sur tous les nouveaux projets.','Project Title'=>'Titre du projet','Format'=>'Format','Successfully setup the project "%s".'=>'Mise en place réussie du projet « %s ».','You need to choose and customize the design for your %s.'=>'Vous devez choisir et personnaliser la conception de votre %s.','The content in your project has changed'=>'Le contenu de votre projet a changé','Updated project content.'=>'Mise à jour du contenu du projet.','You have customized this design'=>'Vous avez personnalisé cette conception','The design "%s" has been customized, and its changes will be reflected in all projects that use it.'=>'La conception « %s » a été personnalisée, et ses changements seront reflétés dans tous les projets qui l’utilisent.','You changed the design'=>'Vous avez changé la conception','You chose the design "%1$s" for the %2$s of your project.'=>'Vous avez choisi le design « %1$s » pour 