izing. Please verify you are using an up-to-date web browser.'=>'Il semble y avoir une erreur para parasant. Veuillez vérifier que vous utilisez un navigateur Web à jour.','Also check the WP REST API isn’t disabled by a security plugin. Feel free to contact Print My Blog support.'=>'Vérifiez également que l’API WP REST n’est pas désactivée par un plugin de sécurité. N’hésitez pas à contacter le support Print My Blog.','Loading Content'=>'Contenu de chargement','Loading Comments'=>'Commentaires de chargement','Ordering Posts'=>'Commander des messages','Ordering Comments'=>'Commander des commentaires','Placing Content on Page'=>'Placer du contenu sur la page','Optimizing for Print'=>'Optimisation pour l’impression','Print-Page Ready'=>'Impression-Page prête','There was an error fetching posts. It was: '=>'Il y avait une erreur d’extraction des messages. C’était: ','No response from WP REST API.'=>'Aucune réponse de wp REST API.','Sorry, There was a Problem 😢'=>'Désolé, il y avait un problème 😢','%1$sRead our FAQs%2$s, then feel free to ask for help in %3$sthe support forum.%2$s'=>'%1$s Lisez nos FAQ%2$s, puis n’hésitez pas à demander de l’aide %3$s le forum de soutien. %2$s','Comments'=>'Commentaires','No Comments'=>'Aucun commentaire','<span class="screen-reader-text says">says:</span>'=>'<span class="screen-reader-text says">Dit:</span>','ID:'=>'ID :','By'=>'Par','Protected:'=>'protégé:','Private:'=>'Privée :','Copied! Ready to paste.'=>'Copié! Prêt à coller.','There was an error copying. You can still select all the text manually and copy it.'=>'Il y a eu une copie d’erreur. Vous pouvez toujours sélectionner tout le texte manuellement et le copier.','Title'=>'Titre','Date'=>'Date','Delete'=>'Supprimer','Untitled'=>'Sans titre','Duplicate'=>'Dupliquer','Feature included in Professional and Business licenses'=>'Fonctionnalité incluse dans les licences Professional et Business','Started'=>'Commencé','%1$s at %2$s'=>'%1$s à %2$s','Y/m/d'=>'d/m/Y','g:i a'=>'g:i a','Click "Add New Project" 👆 To Make Your First Project!'=>'Cliquez sur « Ajouter un nouveau projet » 👆 pour faire votre premier projet!','Classic Print PDf'=>'Imprimé classique PDf','Font Settings'=>'Polices','Paragraph Indent'=>'Paragraphe Indent','Indent the first line of each new paragraph instead of adding a paragraph break.'=>'Indent la première ligne de chaque nouveau paragraphe au lieu d’ajouter une pause paragraphe.','Link, Page Reference, and Footnote Settings'=>'Paramètres de lien, de référence de page et de note de bas de page','Remove'=>'Supprimer','Replace with page reference'=>'Remplacer par la référence de page','Replace with footnote'=>'Remplacer par une note de bas de page','Internal Hyperlinks'=>'Hyperliens internes','How to display hyperlinks to content included in this project.'=>'Comment afficher les hyperliens vers le contenu inclus dans ce projet.','External Hyperlinks'=>'Hyperliens externes','How to display hyperlinks to content not included in this project.'=>'Comment afficher des hyperliens vers du contenu non inclus dans ce projet.','Classic Digital PDF'=>'PDF numérique classique','Buurma Digital PDF'=>'Buurma Pdf numérique','Title Page Top-Banner Color'=>'Page de titre Top-Banner Color','Image used at the top of the background on the title page.'=>'Image utilisée en haut de l’arrière-plan sur la page de titre.','Background Color'=>'Couleur d’arrière-plan','A gradient between this color and white will be used in the page backgrounds'=>'Un gradient entre cette couleur et le blanc sera utilisé dans les arrière-plans de la page','Organization Name'=>'Nom de l\'organisation','Shown in the title page. Eg "Institute of Print My Blog"'=>'Affiché dans la page de titre. Par exemple " Institut de l’impression mon blog »','Background Embellishment'=>'Embellissement de fond','Faded image used as a full-page background on the title page, and next to the page number on numbered pages.'=>'Image fanée utilisée comme arrière-plan pleine page sur la page de titre, et à côté du numéro de page sur les pages numérotées.','Issue'=>'Publication','Text that appears at the top-right of the cover'=>'Texte qui apparaît en haut à droite de la couverture','ByLine'=>'Par ligne','Project Author(s)'=>'Auteur du projet','Date Issued'=>'Date d\'émission','Text that appears under the byline'=>'Texte qui apparaît sous la ligne de touche','Coverpage Preamble'=>'Préambule coverpage','Explanatory text that appears at the bottom of the cover page'=>'Texte explicatif qui apparaît au bas de la page de couverture','Mayer Digital PDF'=>'Mayer Digital PDF','Each Post Begins on a New Page'=>'Chaque message commence sur une nouvelle page','Browser support for pagebreaks on columns is typically not very good.'=>'La prise en charge par le navigateur des sauts de page sur les colonnes n’est généralement pas très bonne.','Whether to force posts to always start on a new page. Doing so makes the page more legible, but uses more paper.'=>'S’il vous agit de forcer les messages à toujours démarrer sur une nouvelle page. Cela rend la page plus lisible, mais utilise plus de papier.','Show Post Header inside Columns'=>'Afficher l’en-tête de poste à l’intérieur des colonnes','Check this to make post header information, like title, date, author, etc, appear inside columns; uncheck this to have it take up the full page width'=>'Vérifiez ceci pour faire l’information d’en-tête de poteau, comme le titre, la date, l’auteur, etc., apparaissent dans des colonnes ; décocher cela pour qu’il prenne la largeur de la pleine page','Show a Dividing Line Between Posts'=>'Afficher une ligne de démarcation entre les messages','Full-Column Images'=>'Images pleine colonne','Resizes images to be the full column width (except ones with the CSS class "mayer-no-resize")'=>'Redimensionner les images pour être la largeur complète de la colonne (sauf ceux avec la classe CSS « mayer-no-resize »)','Remove Extra Columns'=>'Supprimer les colonnes supplémentaires','Forces your content to only use two columns, even if the content itself was divided into more columns (eg using the "Columns" block)'=>'Oblige votre contenu à n’utiliser que deux colonnes, même si le contenu lui-même a été divisé en plus de colonnes (par exemple en utilisant le bloc « Colonnes »)','Byline'=>'Par ligne','Project author(s)'=>'Auteur du projet(s)','Classic ePub'=>'ePub classique','Convert Videos to Images and Links'=>'Convertir des vidéos en images et en liens','Some eReaders don\'t show videos, in which case you may prefer to replace them with an image and a hyperlink to the online video content.'=>'Certaines liseuses ne montrent pas de vidéos, auquel cas vous préférerez peut-être les remplacer par une image et un lien hypertexte vers le contenu vidéo en ligne.','Title page and Part Header Font Size'=>'Page de titre et taille de police d’en-tête de partie','Font size used for the default title page’s and part’s header (all other headers’ sizes are derived from the main font size). Use any recognized %1$sCSS font-size keyword%2$s (like "large", "medium", "small") or a %3$slength in any units%2$s (eg "14pt", "50%%", or "10px").'=>'Taille de police utilisée pour la page de titre par défaut et l’en-tête de la pièce (toutes les tailles des autres en-têtes sont dérivées de la taille principale de la police). Utilisez n’importe quel mot clé reconnu %1$sCS de la taille d’une police%2$s (comme « grand », « moyen », « petit ») ou une %3$slengage dans toutes les unités%2$s (par exemple « 14pt », « 50 %% » ou « 10px »).','Custom Header Font'=>'Police de l’entête','Default font to use for headers of articles, parts, etc. Font files with extension "ttf" work with most eBook readers. Leave blank to use the default font.'=>'Police par défaut à utiliser pour les en-têtes d’articles, de pièces, etc. Les fichiers de polices avec l’extension « ttf » fonctionnent avec la plupart des lecteurs de livres électroniques. Laissez le champ vide pour utiliser la police par défaut.','Font Size'=>'Taille de la police','Use any recognized %1$sCSS font-size keyword%2$s (like "large", "medium", "small") or a %3$slength in any units%2$s (eg "14pt", "50%%", or "10px").'=>'Utilisez n’importe quel mot clé reconnu %1$sCS de la taille d’une police%2$s (comme « grand », « moyen », « petit ») ou une %3$slengage dans toutes les unités%2$s (par exemple « 14pt », « 50 %% » ou « 10px »).','Custom Font'=>'Police personnalisée','Default font used in paragraphs, lists, tables, captions, etc. Font files with extension "ttf" work with most eBook readers. Leave blank to use the default font.'=>'Police par défaut utilisée dans les paragraphes, les listes, les tableaux, les légendes, etc. Les fichiers de polices avec l’extension « ttf » fonctionnent avec la plupart des lecteurs de livres électroniques. Laissez le champ vide pour utiliser la police par défaut.','File name'=>'Nom du fichier','Description'=>'Description','Shown as eBook metadata.'=>'Affiché sous forme de métadonnées eBook.','Cover Image'=>'Image de couverture','Cover image used on eBook file (does not necessarily appear inside project). Ideal dimensions are 2,560 x 1,600 pixels.'=>'Image de couverture utilisée sur le fichier eBook (n’apparaît pas nécessairement dans le projet)','Classic Word'=>'Word classique','Headers and Footers'=>'Police de l’entête','Document Header on First Page'=>'En-tête du document sur la première page','Content to appear in top margin area but only on the first page.'=>'Le contenu doit apparaître dans la zone de marge supérieure, mais uniquement sur la première page.','Document Header on Subsequent Pages'=>'En-tête du document sur les pages suivantes','Content to appear in top margin area on all pages except the first page.'=>'Le contenu doit apparaître dans la zone de marge supérieure sur toutes les pages à l’exception de la première page.','Document Footer'=>'Pied de page du document','Content to appear in bottom margin area.'=>'Contenu de chaque publication à imprimer.','Some Word Processors don\'t show videos, in which case you may prefer to replace them with an image and a hyperlink to the online video content.'=>'Certains traitements de texte n\'affichent pas les vidéos, auquel cas vous préférerez peut-être les remplacer par une image et un lien hypertexte vers le contenu vidéo en ligne.','Maximum Image Height (in pixels)'=>'Hauteur maximale de l’image (en pixels)','Larger images will be resized to this, smaller images will be unchanged.'=>'Les images plus grandes seront resized à cela, les images plus petites seront inchangées.','Leave as hyperlink to website'=>'Laisser comme lien hypertexte vers le site Web','Leave as hyperlink to document'=>'Laisser comme lien hypertexte vers le document','Leave as hyperlink'=>'Laisser comme hyperlien','Haller Tabloid Print PDF'=>'Tabloïd Haller Imprimer PDF','Logo image to show on the front page and in the header of subsequent pages. Leave blank to just use a "Title of Publication".'=>'Image du logo à afficher sur la première page et dans l’en-tête des pages suivantes. Laissez vide pour utiliser simplement un « Titre de publication ».','Title of Publication'=>'Titre de la publication','Shown in a large font on front page and in the top margin of every subsequent page.'=>'Affiché dans une grande police sur la page d’accueil et dans la marge supérieure de chaque page suivante.','Subtitle of Publication'=>'Sous-titre de la publication','Shown under the name of the publication, in a slightly smaller font.'=>'Affiché sous le nom de la publication, dans une police légèrement plus petite.','Publication Preamble'=>'Préambule de publication','Shown on the front page under the Title and Subtitle.'=>'Affiché sur la première page sous le titre et le sous-titre.','Columns'=>'Colonnes','Number of columns to use for content.'=>'Nombre de colonnes à utiliser pour le contenu.','Shown on frontpage and in the top margin of all subsequent pages.'=>'Affiché sur la page d’accueil et dans la marge supérieure de toutes les pages suivantes.','Issue Number'=>'Numéro de série','Shown on the frontpage and in the top margin of all subsequent pages (shortcodes supported).'=>'Affiché sur la page d’accueil et dans la marge supérieure de toutes les pages suivantes (shortcodes pris en charge).','Frontpage Title Left Call-Out'=>'Titre de la page d’accueil Appel gauche','HTML displayed to the left of the title on the frontpage (shortcodes supported).'=>'HTML affiché à gauche du titre sur la page d’accueil (shortcodes pris en charge).','Frontpage Title Right Call-Out'=>'Appel droit du titre de la page d’accueil','HTML displayed to the right of the title on the frontpage'=>'HTML affiché à droite du titre sur la page d’accueil','Subtitle'=>'Sous-titre','Source Location'=>'Emplacement de la source','Shown on the title page under the subtitle. Could be your website’s URL, or anything else you like.'=>'Affiché sur la page de titre sous le sous-titre. Peut-être l’URL de votre site Web, ou tout ce que vous aimez.','Site URL'=>'URL du site','Date Printed'=>'Date imprimée','Title Page Content'=>'Contenu de la page titre','Post Title'=>'Titre de l\'article','ID'=>'ID','Author'=>'Auteur','Published Date'=>'Date de publication','Categories and Tags'=>'Catégories et Étiquettes','URL'=>'URL','Featured Image'=>'Image à la une','Excerpt'=>'Extrait','Custom Fields'=>'Champs personnalisés','Content'=>'Contenu','Post Content'=>'Contenu de l\'article','Content from each post to print.'=>'Contenu de chaque publication à imprimer.','Image & Block Settings'=>'Réglages d’image et de bloques','Page Settings'=>'Paramètres de la page','Page Width'=>'Largeur de page','Not supported by some browsers'=>'Non pris en charge par certains navigateurs','Use standard %1$sCSS units%2$s'=>'Utilisez des %1$sCSS standard%2$s','Page Height'=>'Hauteur de la page','Your theme, "%1$s", can be used in conjunction with your design. Themes are often not intended for print and can conflict with the design, but you may have content that looks broken without the theme.'=>'Votre thème, « %1$s », peut être utilisé en conjonction avec votre conception. Les thèmes ne sont souvent pas destinés à l’impression et peuvent entrer en conflit avec la conception, mais vous pouvez avoir du contenu qui semble cassé sans le thème.','Note: this option is only supported for the business license.'=>'Remarque : cette option n’est prise en charge que pour la licence d’entreprise.','Don’t Change Image Quality'=>'Ne modifiez pas la qualité de l’image','%s pixels wide'=>'%s pixels de large','Full Size (on web)'=>'Taille Réelle (sur le web)','Uploaded Size (largest possible)'=>'Taille téléchargée (la plus grande possible)','Image Quality (in pixels)'=>'Hauteur maximale de l’image (en pixels)','Lower quality means smaller file size, whereas higher quality means higher resolution images. Note: if images are missing from the generated PDF, the requested image size might not be available. Use the %1$s Regenerate Thumbnails plugin%2$s to create the missing image sizes.'=>'Une qualité inférieure signifie une taille de fichier plus petite, tandis qu’une qualité supérieure signifie des images de résolution plus élevée. Remarque : si des images sont manquantes dans le fichier PDF généré, la taille d’image demandée peut ne pas être disponible. Utilisez le plugin %1$s Regenerate Thumbnails%2$s pour créer les tailles d’image manquantes.','Apply Website Theme'=>'Appliquer le thème du site Web','Custom CSS'=>'CSS personnalisé','Styles to be applied only when printing projects using this design.'=>'Styles à appliquer uniquement lors de l’impression de projets utilisant cette conception.','Add "Powered By"'=>'Ajouter « Energizado por »','In compliance with WordPress.org guidelines, not added when printing from your browser.'=>'Uniquement ajouté lors de l’utilisation du service d’impression Pro pour les utilisateurs gratuits et amateurs. Conformément aux directives WordPress.org, pas ajouté lors de l’impression à partir de votre navigateur.','Instructs the Pro PDF Service to add "Powered by Print My Blog Pro & WordPress" to your project. Does not appear when printing using your browser.'=>'Demande au Service Pro Print d’ajouter « Powered by Print My Blog Pro & WordPress » dans le pied de la première page. N’apparaît pas lors de l’impression à l’aide de votre navigateur.','Page Reference Text'=>'Texte de référence de page','Text to use when replacing a hyperlink with a page reference. "%s" will be replaced with the page number.'=>'Texte à utiliser lors du remplacement d’un hyperlien par une référence de page. « %s » sera remplacé par le numéro de page.','(see page %s)'=>'(voir page %s)','You must include "%s" in the page reference text so we know where to put the page number.'=>'Vous devez inclure « %s » dans le texte de référence de la page afin que nous s s’ensaurions où mettre le numéro de page.','Internal Footnote Text'=>'Texte de note de bas de page','Text to use when replacing a hyperlink with a footnote. "%s" will be replaced with the page number.'=>'Texte à utiliser lors du remplacement d’un hyperlien par une référence de page. « %s » sera remplacé par le numéro de page.','See page %s.'=>'(voir page %s)','You must include "%s" in the footnote text so we know where to put the URL.'=>'Vous devez inclure « %s » dans le texte de la note de bas de page afin que nous s s’ensaurions où mettre l’URL.','External Footnote Text'=>'Texte de note de bas de page','Text to use when replacing a hyperlink with a footnote. "%s" will be replaced with the URL'=>'Texte à utiliser lors du remplacement d’un hyperlien par un foonote. « %s » sera remplacé par l’URL','See %s.'=>'Voyez %s.','None'=>'Aucun','Center'=>'Centre','Default Image Alignment'=>'Alignement par défaut de l’image','Images normally default to "no alignment", which can look jumbled in printouts. Usually it’s best to automatically switch those to align to the center.'=>'Images normalement par défaut à « pas d’alignement », qui peut sembler confus dans les impressions. Habituellement, il est préférable de les changer automatiquement pour s’aligner sur le centre.','Don’t move'=>'ne Bouge pas','Snap to the top or bottom of the page'=>'Enclencher en haut ou en bas de la page','Only snap if it would otherwise cause a page break'=>'Ne craquez que si l’image provoquerait une rupture de page','Resize images if they don’t fit on the page'=>'Redimensionner les images si elles ne rentrent pas sur la page','Image and Block Placement'=>'Placement de l’image et de bloques','Image snapping and dynamic resizing only works using the Pro PDF Service.'=>'L’accrochage d’image et le redimensionnement dynamique ne fonctionnent qu’avec Pro Print.','To reduce whitespace around images, galleries, and tables, Print My Blog can adjust the placement of your content, or resize it according to the space on the page.'=>'Pour réduire l’espace blanc autour des images, Print My Blog peut déplacer des images dans votre contenu.','Minimum Image Size (in pixels)'=>'Hauteur maximale de l’image (en pixels)','Any images larger than this may be resized to fit onto the page, but they will be no smaller than this size.'=>'Toutes les images plus grandes que cela peuvent être redimensionnées pour s’adapter à la page, mais elles ne seront pas plus petites que cette taille.','Add QR Code to Videos'=>'Ajouter un code QR aux vidéos','After a video is converted into a screenshot and URL, you can optionally add a QR code that readers can scan with their phones to view the video.'=>'Une fois qu’une vidéo est convertie en capture d’écran et URL, vous pouvez éventuellement ajouter un code QR que les lecteurs peuvent scanner avec leur téléphone pour visionner la vidéo.','Arial'=>'Arial','Courier New'=>'Courier New','Georgia'=>'Géorgie','Impact'=>'Impact','Lucida Console'=>'Console Lucida','Palatino Linotype'=>'Palatino Linotype','Tahoma'=>'Tahoma','Times New Roman'=>'Times New Roman','Verdana'=>'Verdana','Custom Font...'=>'Police personnalisée...','Header Font'=>'Police de l’entête','Default font for header tags'=>'Police par défaut pour les balises d’en-tête','Specify the URL of a custom font file, or upload one. The formats "wff" and "wff2" work best, but "ttf" and "otf" also work.'=>'Spécifiez l’URL d’un fichier de police personnalisé ou téléchargez-en un. Les formats « wff » et « wff2 » fonctionnent mieux, mais « ttf » et « otf » fonctionnent également.','Font'=>'Police','Default font used in paragraphs, bulleted lists, tables, etc.'=>'Police par défaut utilisée dans les paragraphes, les listes de balles, les tables, etc.','A simple but flexible design intended mainly for reading from screens, inspired by Print My Blog Quick Print.'=>'Un design simple mais flexible destiné principalement à la lecture à partir d’écrans, inspiré par Print My Blog Free.','Title page, with working hyperlinks.'=>'Page de titre, avec hyperliens de travail.','Main matter, showing hyperlinks and large images.'=>'Matière principale, montrant des hyperliens et de grandes images.','Editorial Review'=>'Revue éditoriale','Your writing in an easy-to-review format for editors.'=>'Votre écriture dans un format facile à examiner pour les éditeurs.','Title page, showing the double-spaced text.'=>'Page de titre, montrant le texte double-espacé.','Main matter, showing smaller images and double-spaced text.'=>'Matière principale, montrant des images plus petites et du texte doublement espacé.','Classic Print PDF'=>'Pdf d’impression classique','A simple but flexible design intended for printing, inspired by Print My Blog Quick Print'=>'Un design simple mais flexible destiné à l’impression, inspiré par Print My Blog Gratuit','Title page, showing removed hyperlinks.'=>'Page de titre, montrant les hyperliens supprimés.','Main matter, showing external hyperlinks automatically converted into footnotes. Page numbers are always on the bottom-outside corner, and each article’s title is shown at the top of right pages.'=>'Matière principale, montrant des hyperliens externes automatiquement convertis en notes de bas de page. Les numéros de page sont toujours dans le coin inférieur à l’extérieur, et le titre de chaque article est affiché en haut des pages droites.','Economical Print PDF'=>'Impression économique PDF','Compact design meant to save paper but still deliver all the content.'=>'Conception compacte destinée à économiser du papier tout en déliant tout le contenu.','Title page, showing smaller text.'=>'Page de titre, montrant un texte plus petit.','Main matter, showing smaller text and images to reduce ink usage.'=>'Matière principale, montrant plus petit texte et images pour réduire l’utilisation de l’encre.','Buurma Whitepaper'=>'Buurma Livre blanc','Stylized and branded PDF designed mainly for reading from a device, great for organizations'=>'Pdf stylisé et de marque conçu principalement pour la lecture à partir d’un appareil, idéal pour les organisations','Title page, showing a stylzed upper margin for a company name, background gradient and logo, among other things.'=>'Page de titre, montrant une marge supérieure stylzed pour un nom d’entreprise, gradient d’arrière-plan et logo, entre autres choses.','Main matter, showing working hyperlinks (which also each get an automatic footnote), and page number and logo in bottom-right corner.'=>'Matière principale, montrant les hyperliens de travail (qui obtiennent également chacun une note de bas de page automatique), et le numéro de page et le logo dans le coin inférieur droit.','Issue 01'=>'Numéro 01','Text explaining the purpose of the paper and gives a brief summary of it, so folks know they’re reading the right thing.'=>'Texte expliquant le but du document et donne un bref résumé de celui-ci, afin que les gens s’en asurment qu’ils lisent la bonne chose.','Mayer Magazine'=>'Mayer Magazine','Digital 2-column magazine inspired by the defunct Zinepal'=>'Magazine numérique à 2 colonnes inspiré de la défunte Zinepal','Title page and table of contents both fit on the first page.'=>'La page de titre et la table des contenus s’inscrivent toutes deux sur la première page.','Two column layout which compactly shows content and images.'=>'Mise en page de deux colonnes qui affiche compactement le contenu et les images.','Simple ePub for using when uploading as an eBook to Amazon and other epub marketplaces'=>'EPub simple à utiliser lors du téléchargement en tant qu’eBook sur Amazon et d’autres marchés epub','Simple Microsoft Word document when that format is required.'=>'Document Microsoft Word simple lorsque ce format est requis.','Title page and table of contents.'=>'Page de titre et table des matières.','Simple layout'=>'Mise page simple','Haller Tabloid'=>'Tabloïd Haller','Print-ready newspaper design'=>'Conception de journaux prêts à imprimer','Digital PDF'=>'PDF numérique','PDF file intended for viewing on a computer, tablet or phone, but not necessarily for printing to paper. Usually includes working hyperlinks, ample colors, and other features that require a device.'=>'Fichier PDF destiné à être consulté sur un ordinateur, une tablette ou un téléphone, mais pas nécessairement pour l’impression sur papier. Inclut habituellement les hyperliens de travail, les couleurs amples, et d’autres dispositifs qui exigent un dispositif.','Print-Ready PDF'=>'PDF prêt à imprimer','PDF file intended for printing on your home printer or with a printer service. Usually removes hyperlinks, avoids excessive ink use, and are designed for viewing the 2-page spread (using the front and back of a page).'=>'Fichier PDF destiné à l’impression sur votre imprimante domestique ou avec un service d’imprimante. Supprime habituellement les hyperliens, évite l’utilisation excessive d’encre et est conçu pour afficher la diffusion de 2 pages (en utilisant l’avant et l’arrière d’une page).','eBook (ePub)'=>'eBook (ePub)','ePub file intended for reading from an eReader, tablet, or phone; or for publishing on an eBook marketplace like Amazon\'s Kindle Direct Publishing, Apple Books, or Kobo.'=>'Fichier ePub destiné à être lu à partir d’une liseuse, d’une tablette ou d’un téléphone; ou pour la publication sur un marché de livres électroniques comme Kindle Direct Publishing d’Amazon, Apple Books ou Kobo.','Create unlimited ePubs with any purchase.'=>'Créez un nombre illimité d’ePubs avec n’importe quel achat.','Word Document'=>'Document MS Word','File editable in Microsoft Word, Google Docs, and LibreOffice (not Apple\'s Pages app, unfortunately). Useful for sharing persons and programs that require a ".doc" file. Word Documents typically require manual formatting in your chosen Word Processor.'=>'Fichier modifiable dans Microsoft Word, Google Docs, LibreOffice, etc. Utile pour partager des personnes et des programmes qui nécessitent un fichier « .doc ». Les documents Word nécessitent généralement une mise en forme manuelle dans le traitement de texte de votre choix.','Create unlimited Word Documents with a Pro Plan.'=>'Créez des documents Word illimités avec un plan Pro.','About Quick Print'=>'À propos de Quick Print','This is the quick-and-easy option, best for making printouts for your own records. For something more professional and full-featured, use %1$sPro Print%2$s. It has free and paid options. %3$sSee full feature comparison.%2$s'=>'C’est l’option rapide et facile, la meilleure pour faire des impressions pour vos propres enregistrements. Pour quelque chose de plus professionnel et complet, utilisez %1$sPro Print%2$s. Il a des options gratuites et payantes. %3$s Voir la comparaison complète des fonctionnalités. %2$s','About Pro Print'=>'À propos de Pro Print','Pro Print is the best way to make professional-quality documents. You will be able to print them for free using your browser, or upgrade to use Print My Blog Pro\'s full features. %1$sSee full feature comparison.%2$s'=>'Pro Print est la meilleure façon de fabriquer des documents de qualité professionnelle. Vous serez en mesure de les imprimer gratuitement en utilisant votre navigateur, ou mise à niveau pour utiliser les fonctionnalités complètes de Print My Blog Pro. %1$s Voir la comparaison complète des fonctionnalités. %2$s','If you just want something quick, use %1$sQuick Print%2$s instead.'=>'Si vous voulez juste quelque chose de rapide, utilisez %1$sQuick Print%2$s la place.','Project Designs are like WordPress Themes'=>'Les conceptions de projets sont comme les thèmes WordPress','Each has a different look and options that can be customized.'=>'Chacun a un look différent et des options qui peuvent être personnalisés.','The "Classic" design is the most similar Print My Blog’s Quick Print, so it’s a good default choice.'=>'Le design « Classic » est l’impression la plus similaire mon blog Quick Print, il est donc un bon choix par défaut.','Click on the preview image for more details, and feel free to come back to this page later if you want to try a different design.'=>'Cliquez sur l’image d’aperçu pour plus de détails, et n’hésitez pas à revenir à cette page plus tard si vous voulez essayer un design différent.','Read the User Guide'=>'Lire le guide de l’utilisateur','Each Design has Different Options and is Reusable'=>'Chaque conception a des options différentes et est réutilisable','Below are your chosen design’s customization options.'=>'Voici les options de personnalisation de votre conception choisies.','If you don’t see an option you need, you may want to go back and choose a different design, or ask the design’s author for it.'=>'Si vous ne voyez pas une option dont vous avez besoin, vous pouvez revenir en arrière et choisir un design différent, ou demander à l’auteur de la conception pour elle.','Note: designs are reused between projects. So customizations to this design will be reused by other projects using this same design'=>'Remarque : les dessins sont réutilisés entre les projets. Ainsi, les personnalisations de cette conception seront réutilisées par d’autres projets utilisant cette même conception','How to Edit Project Content'=>'Comment modifier le contenu du projet','Find the articles (posts, pages, other post types) from WordPress you want to add on the left, and add it to your project on the right by dragging'=>'Trouvez les articles (publications, pages, autres types de publications) de WordPress que vous souhaitez ajouter à gauche, et ajoutez-le à votre projet à droite en faisant glisser','Title Page and Table of Contents print materials are automatically added to each project, but you can remove or %1$scustomize them%2$s.'=>'Les documents imprimés de la page de titre et de la table des matières sont automatiquement ajoutés à chaque projet, mais vous pouvez les supprimer ou les %1$s personnaliser %2$s.','Place articles in either front matter, body, or back matter, according to how you want your project organized. Each design can style them differently (eg front matter is often is numbered with roman numerals)'=>'Placez des articles dans la matière avant, la matière principale, ou la matière arrière, selon la façon dont vous voulez que votre projet organisé. Chaque conception peut les coiffer différemment (par exemple la matière avant est souvent numérotée avec des chiffres romains)','Nest content inside others to create parts'=>'Contenu de nid à l’intérieur des autres pour créer des pièces','Read the User Guide on how to edit your project\'s content.'=>'Lisez le Guide de l’utilisateur pour savoir comment modifier le contenu de votre projet.','Everything Else About Your Project is Stored Here'=>'Tout le reste de votre projet est stocké ici','Different formats and designs may require other information about your project.'=>'Différents formats et conceptions peuvent nécessiter d’autres informations sur votre projet.','Some examples of metadata are: title page info, file info, or copyright data.'=>'Voici quelques exemples de métadonnées : informations sur la page de titre, informations de fichier ou données sur le droit d’auteur.','So although your choice of design may affect what metadata is required, it is not shared with other projects.'=>'Ainsi, bien que votre choix de conception puisse affecter les métadonnées requises, il n’est pas partagé avec d’autres projets.','Generate and View Your File'=>'Générer et afficher votre fichier','Your project is ready to be generated! Clicking "Generate" will compile your content into a print-page.'=>'Votre projet est prêt à être généré! En cliquant sur « Générer » compilera votre contenu dans un document. Cliquez ensuite sur « voir ».','Read the User Guide on %1$supdating%2$s, %3$sgenerating the pro file%2$s, and %4$sgetting help%2$s.'=>'Lisez le Guide de l’utilisateur sur %1$supdating%2$s, %3$sgénérer le fichier pro%2$s et %4$sa aidé%2$s.','Posts just for Print My Blog'=>'Articles seulement pour Print My Blog','Print My Blog "Print Materials" are like private posts. They aren’t visible to site visitors, but you can use them in your Pro Print Projects.'=>'Imprimer mon blog « Print Materials » sont comme des messages privés. Ils ne sont pas visibles par les visiteurs du site, mais vous pouvez les utiliser dans vos projets Pro Print.','Title Page'=>'Titre de page','Table of Contents'=>'Table des matières','Single Column'=>'Colonne simple','Fullpage Content'=>'Contenu fullpage','Centered Content'=>'Contenu centré','Full Column Content'=>'Contenu fullpage','Important'=>'Important','Print'=>'Imprimer','Print 🖨'=>'Imprimer 🖨','PDF'=>'PDF','PDF 📄'=>'Pdf 📄','eBook'=>'Livre électronique','eBook 📱'=>'eBook 📱','Invalid format "%s".'=>'Format « %s » non valide.','Site Title'=>'Titre du site','Tagline'=>'Slogan','Filters Used'=>'Filtres utilisés','E.g. selected categories, taxonomies, and date range.'=>'Par exemple, catégories sélectionnées, taxonomies et plage de date.','Credit Print My Blog Plugin'=>'Crédit Imprimer mon blog Plugin','Show some love and tell your readers about Print My Blog %1$s'=>'Montrez un peu d’amour et parlez à vos lecteurs de Print My Blog %1$s','Extra dividing line at end of post'=>'Ligne de démarcation supplémentaire à la fin du poste','1'=>'1','2'=>'2','3'=>'3','The number of columns of text on each page. Not supported by some web browsers.'=>'Le nombre de colonnes de texte sur chaque page. Non pris en charge par certains navigateurs Web.','Pro Print lets you specify header and text size and font'=>'Pro Print vous permet de spécifier l’en-tête et la taille du texte et la police','Tiny (1/2 size)'=>'Minuscule (taille 1/2)','Small (3/4 size)'=>'Petit (taille 3/4)','Normal (theme default)'=>'Normal (thème par défaut)','Large (slightly larger than normal)'=>'Grand (légèrement plus grand que la normale)','Image Size'=>'Taille de l\'image','Full (theme default)'=>'Complet (thème par défaut)','Large (3/4 size)'=>'Grand (taille 3/4)','Medium (1/2 size)'=>'Moyen (taille 1/2)','Small (1/4 size)'=>'Petit (taille 1/4)','None (hide images)'=>'Aucun (masquer des images)','If you want to save paper, choose a smaller image size, or hide images altogether.'=>'Si vous souhaitez enregistrer du papier, choisissez une plus petite taille d’image ou cachez des images.','Include Hyperlinks'=>'Inclure hyperliens','Pro Print with Pro PDF Service supports changing hyperlinks to page references or footnotes'=>'Pro Print with Pro PDF Service prend en charge la modification des hyperliens vers les références de page ou les notes de bas de page','Include'=>'Inclure','Replace with URL in Parenthesis'=>'Remplacer par l’URL dans Parenthèse','Note: PDFs generated in Firefox and Safari automatically remove hyperlinks. If you want your PDF to include hyperlinks, please use another browser.'=>'Remarque : Les FICHIERS PDF générés dans Firefox et Safari suppriment automatiquement les hyperliens. Si vous souhaitez que votre PDF inclue des hyperliens, veuillez utiliser un autre navigateur.','Post Rendering Wait-Time'=>'Temps d’attente de rendu de poste','ms'=>'ms','Milliseconds to wait between rendering posts. If posts are rendered too quickly on the page, sometimes images won’t load properly. '=>'Millisecondes à attendre entre les poteaux de rendu. Si les publications sont rendues trop rapidement sur la page, parfois les images ne se chargent pas correctement. ','Include Inline Javascript'=>'Inclure Javascript en ligne','Sometimes posts contain inline javascript which can cause errors and stop the page from rendering.'=>'Parfois, les publications contiennent javascript en ligne qui peut causer des erreurs et arrêter le rendu de la page.','Include Unrendered Shortcodes'=>'Inclure des codes courts non mis en œché','If you left shortcodes from deactivated deactivated plugins or themes in your posts, they are automatically removed from printouts. Check this to leave them.'=>'Si vous avez laissé des codes courts à partir de plugins ou de thèmes désactivés désactivés dans vos publications, ils sont automatiquement supprimés des impressions. Vérifiez ceci pour les laisser.','article'=>'article','part'=>'partie','volume'=>'volume','anthology'=>'anthologie','No generator class specified for format "%s"'=>'Aucune classe de générateur spécifiée pour le format « %s »','Setup'=>'Configuration','Choose %s Design'=>'Choisissez la conception %s ','Customize %s Design'=>'Personnaliser la conception %s','Edit Content'=>'Modifier le contenu','Edit Metadata'=>'Éditer les métadonnées','Generate Print Page'=>'Générer la page d’impression','The design with slug "%s" should exist but doesn\'t. Check the plugin that added that design is still active (and if it required a subscription, that the subscription is still up-to-date). For now, please choose a different design.'=>'Le design avec slug « %s » devrait exister mais ne existe pas. Vérifiez que le plugin qui a ajouté que la conception est toujours actif (et s’il nécessitait un abonnement, que l’abonnement est toujours à jour). Pour l’instant, veuillez choisir un design différent.','Template file "%s" should exist but doesn\'t.'=>'Fichier modèle « %s » devrait exister, mais ne fonctionne pas.','Default Template'=>'Modèle par défaut','No license ID available'=>'Aucun id de licence disponible','There is no site registered with Freemius'=>'Il n’y a pas de site enregistré auprès de Freemius','Your project is very big and you might have errors downloading the file. If so, try splitting your content into multiple projects and instead creating multiple smaller files.'=>'Votre projet est très volumineux et vous pourriez avoir des erreurs lors du téléchargement du fichier. Si c’est le cas, essayez de diviser votre contenu en plusieurs projets et de créer plusieurs fichiers plus petits.','Your project has lots of images and you might have errors downloading the file. If so, try spltting your content into multiple projects or reducing the image quality set on your design.'=>'Votre projet contient beaucoup d’images et vous pouvez avoir des erreurs lors du téléchargement du fichier. Si c’est le cas, essayez de répartir votre contenu dans plusieurs projets ou de réduire la qualité d’image définie sur votre conception.','Downloading the Paid PDF will use one of your %1$s remaining credits, and is non-refundable.'=>'Le téléchargement du PDF payant utilisera l’un de vos %1$s crédits restants et n’est pas remboursable.','Table of content - In Microsoft Word, please right-click and choose "Update field".'=>'Table des matières - Veuillez cliquer avec le bouton droit de la souris et choisir « Mettre à jour le champ ».','Projects'=>'Projets','Projects for printing with Print My Blog'=>'Projets d’impression avec Imprimer mon blog','Designs for printing with Print My Blog'=>'Dessins pour l’impression avec Imprimer mon blog','Post type general name' . "\4" . 'Print Materials'=>'Matériaux d\'impression','Post type singular name' . "\4" . 'Print Material'=>'Matériaux d\'impression','Admin Menu text' . "\4" . 'Print Materials'=>'Imprimer les matériaux d\'impression','Add New on Toolbar' . "\4" . 'Print Material'=>'Matériaux d\'impression','Add New'=>'Ajouter','Add New Print Material'=>'Ajouter un nouveau matériel d\'impression','New Print