ression','Need to Change Something?'=>'Besoin de changer quelque chose?','Change Title or Format'=>'Modifier le titre ou le format','Clear Cached Resources'=>'Effacer les ressources mises en cache','Get Help'=>'Aide','Edit Project Metadata'=>'Modifier les métadonnées du projet','Edit Project'=>'Modifier le projet','Submit & Proceed'=>'Soumettre et procéder','Pro Print ― Projects'=>'Pro Print ― Projets','Add New Project'=>'Ajouter un nouveau projet','Print My Blog - Settings'=>'Imprimer mon blog - Paramètres','Front-End Print Buttons'=>'Boutons d’impression frontaux','Viewers will see these buttons when they visit your website.'=>'Les spectateurs verront ces boutons lorsqu’ils visiteront votre site Web.','These are the legacy print buttons which use the "Quick Print" technology. We\'re currently working on new print buttons that will use "Pro Print" technology.'=>'Ce sont les anciens boutons d’impression qui utilisent la technologie « Quick Print ». Nous travaillons actuellement sur de nouveaux boutons d’impression qui utiliseront la technologie « Pro Print ».','Posts'=>'Articles','Pages'=>'Pages','Customize Buttons'=>'Personnaliser les boutons','Place Buttons'=>'Placer les boutons','Above Content'=>'Au-dessus du contenu','Below Content'=>'Au-dessous du contenu','Preview Settings'=>'Paramètres de la page de prévisualisation','Open Quick Print preview page in a new tab. '=>'Ouvrir la page d\'aperçu de l\'impression rapide dans un nouvel onglet. ','Note: Leaving this setting unchecked will open the preview page in the active window.'=>'Note : Si ce paramètre n\'est pas coché, la page de prévisualisation s\'ouvrira dans la fenêtre active.','Label'=>'Label','Admin Print Buttons'=>'Boutons d’impression administrateur','Administrators and other privileged users will see these in the wp-admin (like when editing a post.)'=>'Les administrateurs et autres utilisateurs privilégiés les verront dans wp-admin (comme lors de l’édition d’un message).','These print buttons use "Pro P