 ou Google Docs. Remarque : ce n’est pas recommandé pour personnaliser les impressions, car d’autres programmes formatent généralement mal le contenu. Utilisez plutôt les classes CSS d’Print My Blog pour supprimer ou ajouter du contenu des impressions.','Learn More'=>'En savoir plus','Show More Print Options'=>'Afficher plus d’options d’impression','Options'=>'Options','Post Selection'=>'Sélection des postes','Pro Print supports custom post types, combining posts with pages, and print-only materials'=>'Print Print prend en charge les types de publications personnalisées, combinant les publications avec les pages et les matériaux imprimés uniquement','Order'=>'Commande','Pro Print supports drag-and-drop ordering of content.'=>'Pro Print prend en charge la commande de contenu en glisser-déposer.','Posts will be ordered:'=>'Les messages seront commandés :','Oldest First'=>'Anciens d\'abord','Newest First'=>'Plus récents en premier','Pages will be ordered using the "Order" attribute:'=>'Les pages seront commandées à l’aide de l’attribut « Ordre » :','From Lowest to Highest'=>'Du plus bas au plus haut','From Highest to Lowest'=>'Du plus haut au plus bas','Password-Protected'=>'Protégé par mot de passe','Statuses'=>'Statuts','Filters'=>'Filtres','Pro Print supports filtering by custom taxonomies.'=>'Pro Print prend en charge les pages de titre pleine page, les pages de titre personnalisées ou aucune page de titre','Authored By'=>'Auteur par','Posted After (and Including)'=>'Posté après (et y compris)','Posted Before (and Including)'=>'Posté avant (et y compris)','Prepare Print-Page'=>'Préparer print-page','It’s finally here...'=>'C’est enfin là...','Print My Blog – Pro Print!'=>'Print My Blog  — Pro Print','The old features are still here: "Print Now" was just renamed "Quick Print", and the Print Buttons are still available under "Settings".'=>'Les anciennes fonctionnalités sont toujours là: « Print Now » vient d’être rebaptisé « Quick Print », et les boutons d’impression sont toujours disponibles sous « Paramètres ».','Pro Print makes more functional and visually-appealing PDFs using your web browser for free, or the new paid Pro PDF Service.'=>'Pro Print rend les fichiers PDF plus fonctionnels et visuellement attrayants en utilisant votre navigateur Web gratuitement, ou le nouveau service d’impression Pro payant.','Automatic Table of Contents'=>'Table automatique des matières','Add a table of contents to your project, with links and page numbers.'=>'Ajoutez une table de contenu à votre projet, avec des liens et des numéros de page.','Pro PDF Service adds page numbers.'=>'Service d’impression Pro','Automatic page references and footnotes'=>'Convertir automatiquement les hyperliens en références de page et notes de bas de page','Hyperlinks can be automatically converted into references to the page the linked-to content is located, or a footnote with the web address print-out.'=>'Les hyperliens peuvent être automatiquement convertis en références à la page où se trouve le contenu lié, ou en une note de bas de page avec l’impression de l’adresse Web.','Proper margins, page numbers and running heads'=>'Marges, numéros de page et têtes de course appropriés','Clean margins, alternating page numbers, roman numerals for front matter, running chapter heads, and more.'=>'Nettoyer les marges, alterner les numéros de page, les chiffres romains pour la matière avant, exécuter les têtes de chapitre, et plus encore.','Support Custom Post Types'=>'Prise en charge des types de postes personnalisés','Content from other plugins, like WooCommerce Products, or your LMS\'s course materials, can be included in projects.'=>'Le contenu d’autres plugins, comme WooCommerce Products, ou le matériel de cours de votre LMS, peut être inclus dans des projets.','Drag-and-Drop Content Organizer'=>'Glisser-déposer le contenu dans les projets','Drop posts, pages, and other post types into projects in any order. Even organize them into parts.'=>'Déposez des publications, des pages et d’autres types de publications dans des projets dans n’importe quel ordre. Même les organiser en parties.','Premade, Reusable, Customizable Designs'=>'Conceptions préfabriquées, réutilisables et personnalisables','Print My Blog\'s Designs are like WordPress Themes: each has its own look and customization options. Reuse the same design across projects. Or even create your own design using HTML, CSS, and Javascript'=>'Imprimer les designs de mon blog sont comme des thèmes WordPress: chacun a son propre look et options de personnalisation. Réutilisez la même conception entre les projets. Ou même créer votre propre conception en utilisant HTML, CSS, et Javascript','Pro PDF Service lets designs fully control the margins, page backgrounds, and los of other aspects.'=>'Pro PDF Service permet aux conceptions de contrôler entièrement les marges, les arrière-plans des pages et les aspects suivants.','Saveable Projects'=>'Générer le projet','Save where you left off.'=>'Sauvez là où vous vous êtes arrêté.','Front matter, back matter, parts, and print materials'=>'Matière avant, matière de dos, pièces et matériaux d’impression','Add front and back matter to books, organize the content into parts, and add special "print material" posts to use only in your projects'=>'Ajoutez de la matière avant et arrière aux livres, organisez le contenu en parties et ajoutez des messages spéciaux « matériel d’impression » à utiliser uniquement dans vos projets.','Features Include:'=>'Image à la une','Try Pro Print Now'=>'Impression Pro','Learn More on printmy.blog'=>'En savoir plus sur printmy.blog','Please %1$slet me know%2$s if you have any questions!'=>'S\'%1$s s’il vous plaît %2$s-moi savoir%2$s si vous avez des questions!','Best wishes, Mike Nelson, Print My Blog Developer'=>'Meilleurs voeux, Mike Nelson, Print My Blog Developer','Welcome to %s!'=>'Bienvenue sur %s !','Print My Blog Pro'=>'Print My Blog Pro','What would you like to do?'=>'Qu\'est-ce que vous aimeriez faire ?','Print My Blog Now for Free'=>'Imprimer mon blog maintenant gratuitement','Use Quick Print'=>'Utiliser Quick Print','2 clicks to printing'=>'2 clics à imprimer','No watermark'=>'Pas de filigrane','Print Thousands of Pages from your Web Browser'=>'Imprimez des milliers de pages à partir de votre navigateur Web','Let Visitors Print My Blog for Free'=>'Laissez les visiteurs imprimer mon blog gratuitement','Configure the Print Button Settings'=>'Configurer les paramètres du bouton d’impression','No Coding Required'=>'Aucun codage requis','Highly Customizable'=>'Association Agate','Place Print Buttons Anywhere'=>'Placez les boutons d’impression n’importe où','Make Professional Books and Documents'=>'Faire des livres et des documents professionnels','Use Pro Print'=>'Utiliser Pro Print','Free and Paid Options'=>'Gratuit, avec options payantes','Drag-and-drop content into projects'=>'Glisser-déposer le contenu dans les projets','Include any post types, in any order'=>'Inclure tous les types de postes, dans n’importe quel ordre','Choose and Customize Many Designs, or code your own'=>'Choisissez et personnalisez de nombreux designs ou codez vos propres','Automatically convert hyperlinks to page references and footnotes'=>'Convertir automatiquement les hyperliens en références de page et notes de bas de page','https://printmy.blog'=>'https://printmy.blog','Make printing your blog easy and impressive. For you & your visitors. One post or thousands.'=>'Rendez l’impression de votre blog facile et impressionnante. Pour vous et vos visiteurs. Un poste ou des milliers.','Michael Nelson'=>'Michael Nelson']];
